selector_to_html = {"a[href=\"scanmode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Mode de scan<a class=\"headerlink\" href=\"#scan-mode\" title=\"Lien vers cette rubrique\">#</a></h1><h2>D\u00e9marrer la configuration<a class=\"headerlink\" href=\"#start-setup\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"scanmode.html#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mode de d\u00e9tection automatique<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Lien vers cette rubrique\">#</a></h2><p>Dans le mode de d\u00e9tection automatique, le scanner d\u00e9tecte la luminosit\u00e9 de l\u2019environnement environnant. Lorsque la luminosit\u00e9 change, le scan est d\u00e9clench\u00e9. Le scan se termine lorsque le scan est r\u00e9ussi ou que le temps de scan d\u00e9passe le temps de travail unique. Peu importe si le dernier scan a \u00e9t\u00e9 r\u00e9ussi ou a \u00e9chou\u00e9, la luminosit\u00e9 de l\u2019environnement environnant sera \u00e0 nouveau d\u00e9tect\u00e9e.</p>", "a[href=\"keyboard.html#keyboard-language\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Langue du clavier<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Lien vers cette rubrique\">#</a></h2><h3>L\u2019Am\u00e9rique<a class=\"headerlink\" href=\"#america\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"system.html#end-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Fin de la configuration<a class=\"headerlink\" href=\"#end-setup\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"keyboard.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Param\u00e8tres du clavier<a class=\"headerlink\" href=\"#keyboard-settings\" title=\"Lien vers cette rubrique\">#</a></h1><h2>D\u00e9marrer la configuration<a class=\"headerlink\" href=\"#start-setup\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"barcode.html#end-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Fin de la configuration<a class=\"headerlink\" href=\"#end-setup\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"character.html#end-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Fin de la configuration<a class=\"headerlink\" href=\"#end-setup\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"system.html#start-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">D\u00e9marrer la configuration<a class=\"headerlink\" href=\"#start-setup\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"character.html#no-end-character\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Aucun caract\u00e8re de fin<a class=\"headerlink\" href=\"#no-end-character\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"barcode.html#start-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">D\u00e9marrer la configuration<a class=\"headerlink\" href=\"#start-setup\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"character.html#start-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">D\u00e9marrer la configuration<a class=\"headerlink\" href=\"#start-setup\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"character.html#enter-cr\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Entr\u00e9e(CR)<a class=\"headerlink\" href=\"#enter-cr\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"#nt-1202-wired-scanner-quick-setup-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Guide d\u2019installation rapide du scanner filaire <strong>NT-1202</strong><a class=\"headerlink\" href=\"#nt-1202-wired-scanner-quick-setup-guide\" title=\"Lien vers cette rubrique\">#</a></h1>", "a[href=\"system.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Param\u00e8tres du syst\u00e8me<a class=\"headerlink\" href=\"#system-settings\" title=\"Lien vers cette rubrique\">#</a></h1><h2>D\u00e9marrer la configuration<a class=\"headerlink\" href=\"#start-setup\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"scanmode.html#end-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Fin de la configuration<a class=\"headerlink\" href=\"#end-setup\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"barcode.html#block-barcodes-with-urls\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bloquer les codes-barres avec des URL<a class=\"headerlink\" href=\"#block-barcodes-with-urls\" title=\"Lien vers cette rubrique\">#</a></h2><p>Bloquer la num\u00e9risation des codes QR URL commen\u00e7ant par <code class=\"docutils literal notranslate\"><span class=\"pre\">http://</span></code>, <code class=\"docutils literal notranslate\"><span class=\"pre\">https://</span></code></p>", "a[href=\"system.html#volume-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">R\u00e9glages du volume<a class=\"headerlink\" href=\"#volume-settings\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer<a class=\"headerlink\" href=\"#enable\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"barcode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Symbologies<a class=\"headerlink\" href=\"#symbologies\" title=\"Lien vers cette rubrique\">#</a></h1><h2>D\u00e9marrer la configuration<a class=\"headerlink\" href=\"#start-setup\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"character.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Param\u00e8tres de caract\u00e8re de fin<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Lien vers cette rubrique\">#</a></h1><p>Le caract\u00e8re de fin est ajout\u00e9 apr\u00e8s le d\u00e9codage des donn\u00e9es au format des donn\u00e9es d\u00e9cod\u00e9es + caract\u00e8re de fin.</p>", "a[href=\"keyboard.html#end-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Fin de la configuration<a class=\"headerlink\" href=\"#end-setup\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"scanmode.html#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mode de d\u00e9clenchement des touches<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Lien vers cette rubrique\">#</a></h2><p>Appuyez sur le bouton pour d\u00e9clencher la num\u00e9risation, et rel\u00e2chez le bouton pour terminer la num\u00e9risation. La num\u00e9risation se termine lorsque le scan r\u00e9ussit ou que le temps de lecture d\u00e9passe le temps de lecture unique.</p>", "a[href=\"scanmode.html#start-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">D\u00e9marrer la configuration<a class=\"headerlink\" href=\"#start-setup\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"barcode.html#only-enable-2d-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Activer uniquement les symboles 2D<a class=\"headerlink\" href=\"#only-enable-2d-symbologies\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"character.html#enter-new-line-crlf\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Entr\u00e9e+Nouvelle ligne(CRLF)<a class=\"headerlink\" href=\"#enter-new-line-crlf\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"keyboard.html#start-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">D\u00e9marrer la configuration<a class=\"headerlink\" href=\"#start-setup\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"scanmode.html#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mode continu<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Lien vers cette rubrique\">#</a></h2><p>Le scanner fonctionne en continu. Si le scan est r\u00e9ussi ou si le temps de scan d\u00e9passe le temps de travail unique, le scan actuel se termine. Si le temps d\u00e9passe le temps sp\u00e9cifi\u00e9, la prochaine analyse est automatiquement d\u00e9clench\u00e9e.</p>", "a[href=\"barcode.html#only-enable-1d-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Activer uniquement les symboles 1D<a class=\"headerlink\" href=\"#only-enable-1d-symbologies\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"system.html#restore-default-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Restaurer les param\u00e8tres par d\u00e9faut<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Lien vers cette rubrique\">#</a></h2><p>Lorsqu\u2019une erreur inconnue se produit sur le scanner, vous pouvez r\u00e9initialiser le scanner en restaurant les param\u00e8tres par d\u00e9faut.</p>", "a[href=\"barcode.html#enable-all-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Activer toutes les symboles<a class=\"headerlink\" href=\"#enable-all-symbologies\" title=\"Lien vers cette rubrique\">#</a></h2>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
